    playbackData.comments = {"dc9c7c4f-5ba0-4e35-8022-65574de63ef1":[{"id":"ba9ae492-23ad-4b08-a40f-d0e37f3b89e6","displayCommentEventId":"dc9c7c4f-5ba0-4e35-8022-65574de63ef1","displayCommentEventSequenceNumber":0,"developerGroupId":"eb747c2b-96ab-432b-b022-1b7e9ad9d30d","timestamp":1728060532486,"commentText":"A playback that deals with more detailed pivot longer situations.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"131377a6-949b-4f71-ab62-30dd0f9c3a04":[{"id":"e2f553cd-0e95-4742-b7da-5cbfce8a9a94","displayCommentEventId":"131377a6-949b-4f71-ab62-30dd0f9c3a04","displayCommentEventSequenceNumber":40,"developerGroupId":"61d852bd-3076-4b31-9c34-46f24d15a2d0","timestamp":1728065054825,"commentText":"","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":["media/videos/1728065052465-PivotLongerVisual.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer_II.r","viewableBlogText":"","commentTags":["video"],"questionCommentData":null}],"83a0e25e-eebc-4f38-b284-67e998eaaf41":[{"id":"269bad7f-a28c-482b-8143-f17fbdbe93b9","displayCommentEventId":"83a0e25e-eebc-4f38-b284-67e998eaaf41","displayCommentEventSequenceNumber":167,"developerGroupId":"61d852bd-3076-4b31-9c34-46f24d15a2d0","timestamp":1728065136555,"commentText":"The <span style=\"font-family: Courier;\">fam</span> data frame is a very small one for example purposes that contains information on families and the children within those families.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728065109466-viewFam.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer_II.r","viewableBlogText":"","commentTags":["image"],"questionCommentData":null}],"4b695051-4b2c-4916-81f5-e8b2cd86f2ff":[{"id":"3c202983-5d63-40c2-a747-9c6c37249979","displayCommentEventId":"4b695051-4b2c-4916-81f5-e8b2cd86f2ff","displayCommentEventSequenceNumber":366,"developerGroupId":"61d852bd-3076-4b31-9c34-46f24d15a2d0","timestamp":1728065373733,"commentText":"The code displayed here follows the previous conventions we've looked at with the <span style=\"font-family: Courier;\">pivot_longer()</span> function. We've specified the three arguments <span style=\"font-family: Courier;\">cols, names_to</span>, and <span style=\"font-family: Courier;\">values_to,</span> in an attempt to view each observation as the data on one child.<div><br></div><div>The output of the data is shown below.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728065263241-pivotChild.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer_II.r","viewableBlogText":"","commentTags":["image","question"],"questionCommentData":{"allAnswers":["Each child has more than one row","Each child has more than one date of birth","Nothing, the data is tidy!"],"correctAnswer":"Each child has more than one date of birth","question":"What is undesirable about this output?","explanation":"We still have to look at the column headers to figure out which date of birth corresponds to the child in the row!"}}],"d73c01e1-0c6c-47c6-afce-2500865cbc68":[{"id":"af810052-8d63-4275-9c2b-0908d38045d7","displayCommentEventId":"d73c01e1-0c6c-47c6-afce-2500865cbc68","displayCommentEventSequenceNumber":657,"developerGroupId":"61d852bd-3076-4b31-9c34-46f24d15a2d0","timestamp":1728065434245,"commentText":"We <span style=\"font-weight: bold;\">are</span>&nbsp;allowed to specify multiple columns in the <span style=\"font-family: Courier;\">names_to</span> argument if we wish to create more than just 1-2 new columns.&nbsp; If we use the (optional) <span style=\"font-family: Courier;\">names_sep</span> argument in combination with <span style=\"font-family: Courier;\">names_to</span>, we will split each column selected via cols at the delimeter specified with <span style=\"font-family: Courier;\">names_sep</span>.&nbsp;&nbsp;<div><br></div><div>In this example, all things left of the underscore in the column names selected will be placed in a column called <span style=\"font-family: Courier;\">\"value_type\"</span>.&nbsp; The numerical values right of the underscore will be put in a column called number.&nbsp;&nbsp;</div><div><br></div><div>Since we didn't specify a new name for the values occurring in these columns via <span style=\"font-family: Courier;\">values_to</span>, the default column title is used (value).</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728065576594-pivotChildDOB.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer_II.r","viewableBlogText":"","commentTags":["image","question"],"questionCommentData":{"allAnswers":["Each child has more than one row","Each child has more than one date of birth","Nothing is wrong, the data is tidy!"],"correctAnswer":"Each child has more than one row","question":"What is undesirable about this output?","explanation":"Now the table is TOO long - each child's information has been split over multiple rows."}}],"3d6a928a-f56e-4225-8e33-6d4a5abb0764":[{"id":"a0f72909-75d1-4950-9913-98640ac32cb5","displayCommentEventId":"3d6a928a-f56e-4225-8e33-6d4a5abb0764","displayCommentEventSequenceNumber":922,"developerGroupId":"61d852bd-3076-4b31-9c34-46f24d15a2d0","timestamp":1728066232483,"commentText":"To finally get this pivoting right, we need a special value we can provide to names_to:&nbsp; <span style=\"font-family: Courier;\">\".value\"</span>.<div><br></div><div>What <span style=\"font-family: Courier;\">\".value\"</span> does is tells us that all values left of the delimiter specified via&nbsp; <span style=\"font-family: Courier;\">names_sep</span> should become their own columns, based on their unique values.&nbsp; Since <span style=\"font-family: Courier;\">\"child\"</span> and <span style=\"font-family: Courier;\">\"dob\"</span> are different, they will get different columns.&nbsp; The values in those columns will stay under their new prefixes (e.g. <span style=\"font-family: Courier;\">\"Bart\"</span> will stay with <span style=\"font-family: Courier;\">\"child\"</span> while <span style=\"font-family: Courier;\">8/1/1980</span> will stay with <span style=\"font-family: Courier;\">\"dob\"</span>).&nbsp; The values on the other side of the delimiter will be moved to a single new column, here named<span style=\"font-family: Courier;\"> \"number\"</span>.</div><div><br></div><div>Below is a visual of the output of this data.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":["media/images/1728066174353-pivotAlmost.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer_II.r","viewableBlogText":"","commentTags":["image","question"],"questionCommentData":{"allAnswers":["Each child has more than one row","Each child has more than one date of birth","Nothing, the data is tidy","I don't like any of these choices"],"correctAnswer":"I don't like any of these choices","question":"What is undesirable about this output?","explanation":"(c) or (d) are correct, based on your viewpoint!"}}],"fe68670d-1674-47a4-8665-84c2f0a14873":[{"id":"0856341d-06c1-42b7-8cc5-b170f5765835","displayCommentEventId":"fe68670d-1674-47a4-8665-84c2f0a14873","displayCommentEventSequenceNumber":997,"developerGroupId":"61d852bd-3076-4b31-9c34-46f24d15a2d0","timestamp":1728066341306,"commentText":"It is nice to remove NA values when we can.&nbsp; Remember we can use <span style=\"font-family: Courier;\">values_drop_na</span> to filter out rows where our families maybe didn't have four children!&nbsp; A different issue to consider for the future is what is families had MORE than four, but only four slots were provided.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/pivot_longer_II.r","viewableBlogText":"","commentTags":[],"questionCommentData":null}]};
